import React, { Component } from 'react';
import back from './assets/back.png'

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="w-100 pl3 staatliches f-subheadline flex justify-center">
          <h1 className="mb0 mt0 z-1">
            Daniel Douangkesone
          </h1>
        </div>
        <div className="w-100 w-50-l pl3 fr">
          <h1>Hello</h1>
          <span>
            I'm a web designer / developer based in Austin, Tx. I have a passion for web design 
            and love to create for web and mobile devices.
          </span>
        </div>
        <div className="w-50">
          <div className="absolute bottom-0">
            <img alt="profile" className="w-30" src={back} />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
